import './app.css';

import Login from './Login';
import LoggedInNavbar from './LoggedInNavbar';
import TopTracks from './pages/TopTracks';
import TopArtists from './pages/TopArtists';

import { useState, useEffect } from 'react';
import { Route, Routes } from 'react-router-dom';


function App() {

  var code = new URLSearchParams(window.location.search).get("code");

  if (code != null) {
    window.localStorage.setItem("USER_SPOTIFY_CODE", code);
  }

  return (
    <div>
      {code ? <LoggedInNavbar code={window.localStorage.getItem("USER_SPOTIFY_CODE")} /> : <Login />}
      <Routes>
        <Route path="/" element={<div>Hi</div>} ></Route>
        <Route path="/top-tracks" element={<TopTracks code={code} />} ></Route>
        <Route path="/top-artists" element={<TopArtists code={code} />} ></Route>
      </Routes>
    </div>
  )

}

export default App;
